import React, { Component } from 'react'

class TickerToggler extends Component {
    constructor(props) {
        super(props)

        this.state = {
                price: true,
                percentChange: false,
                volume: false
        }
    }

    render() {
        return (
            <div> 
                <label for="tickerPptions"> Change Displayed Data </label>
                    <select name="tickerOptions" id="tickerOptions"> 
                        <option value="price">Price</option>
                        <option value="percentChange">Percent Change</option>
                        <option value="volume">Volume</option>
                    </select>
            </div>
        )
    }
}

export default TickerToggler
